import Routes from "./routes";
import { GlobalStyle } from "./styles/GlobalStyles";

function App() {
  return (
    <BrowserRouter>

      <header>

      </header>

      <main>
        <Routes />
      </main>

      <footer>

      </footer>
      <GlobalStyle />
    </BrowserRouter>
  );
}

export default App;
